import PropTypes from 'prop-types'

function Modal(props) {
  return (
    <div className={`modalBackground modalShowing-${props.modalState}`}>
      {props.modalState}
    </div>
  )
}
Modal.propTypes = {
  modalState: PropTypes.string.isRequired
}

export default Modal
